#define ALARM_VOWE_TONE1_LEN (12800)
#define ALARM_VOWE_TONE2_LEN (8394)
#endif /* #if ( CFG_ALARM_TONE_VERSION == 0 ) */

#define ALARM_TONES  (2)

struct alarm_tone {
    void *data;
    int frames;
};

static struct alarm_tone alarm_array[ALARM_TONES] = {
    {
        .data = tone1,
        .frames = ALARM_VOWE_TONE1_LEN,
    },
    {
        .data = tone2,
        .frames = ALARM_VOWE_TONE2_LEN,
    },
};

TaskHandle_t g_handler_alarm;
unsigned int g_alarm_index = 0;

void notify_alarm_play(int value)
{
    g_alarm_index = value;
    xTaskNotifyGive(g_handler_alarm);
}

static void alarm_play(void *arg)
{
    sound_t *w_snd;
    int ret = 0;
    int remain_frame = 0;
    int written_frame = 0;
    unsigned int once_write = 0;

    struct alarm_tone tone;
    struct msd_hw_params params;
    //unsigned int w_bitwidth = 16;
    params.format = MSD_PCM_FMT_S16_LE;
    params.channels = 2;
    params.period_count = 4;
    params.rate = 16000;
    params.period_size = 1024;

    while (1) {
        ulTaskNotifyTake(pdTRUE, portMAX_DELAY);
        if (g_alarm_index < ALARM_TONES) {
            tone = alarm_array[g_alarm_index];
        } else {
            tone = alarm_array[0];
        }
        printf("[%s], begin, alert index:%d\n", __func__, g_alarm_index);

        connect_route("track0", "INTDAC_out", 1, CONNECT_FE_BE);
        connect_route("I_22", "O_20", 1, CONNECT_IO_PORT);
        connect_route("I_23", "O_21", 1, CONNECT_IO_PORT);
        //connect_route("track0", "GASRC0_P", 1, CONNECT_FE_BE);
        //connect_route("GASRC0_P", "dummy_end_p", 1, CONNECT_FE_BE);
        //connect_route("I_22", "O_42", 1, CONNECT_IO_PORT);
        //connect_route("I_23", "O_43", 1, CONNECT_IO_PORT);

        ret = snd_pcm_open(&w_snd, "track0", MSD_STREAM_PLAYBACK, 0);
        if (ret != 0) {
            if (ret == -EBUSY) {
                printf("track0 open busy %d.\n", ret);
                continue;
            }
            printf("track0 open fail %d.\n", ret);
            goto exit;
        }

        snd_pcm_hw_params(w_snd, &params);

        ret = snd_pcm_prepare(w_snd);
        if (ret != 0)
            goto exit;

        remain_frame = tone.frames;
        while (remain_frame) {
            if (remain_frame >= (int)params.period_size * 4) {
                once_write = params.period_size * 4;
            } else {
                once_write = remain_frame;
            }
            ret = snd_pcm_write(w_snd, (void *)((unsigned int *)(tone.data) + written_frame), once_write);
            if (ret != (int)once_write)
                printf("[%s]Warning: write frames: %d", __func__, ret);

            written_frame += once_write;
            remain_frame -= once_write;
            //printf("[%s]written_frame: %d,  remain_frame: %d\n", __func__, written_frame, remain_frame);
        }
        //printf("[%s]Total write frames: %d\n", __func__, written_frame);
        written_frame = 0;
        ret = snd_pcm_drain(w_snd);
        if (ret)
            goto exit;

        ret = snd_pcm_hw_free(w_snd);
        if (ret)
            goto exit;

        ret = snd_pcm_close(w_snd);
        if (ret)
            goto exit;

        connect_route("track0", "INTDAC_out", 0, CONNECT_FE_BE);
        connect_route("I_22", "O_20", 0, CONNECT_IO_PORT);
        connect_route("I_23", "O_21", 0, CONNECT_IO_PORT);
        connect_route("track0", "GASRC0_P", 0, CONNECT_FE_BE);
        connect_route("GASRC0_P", "dummy_end_p", 0, CONNECT_FE_BE);
        connect_route("I_22", "O_42", 0, CONNECT_IO_PORT);
        connect_route("I_23", "O_43", 0, CONNECT_IO_PORT);

        printf("[%s], end\n", __func__);
        static int count = 0;
        count++;
        printf("#### Alert Count %d ####\n", count);
    }

exit:
    vTaskDelete(NULL);
    return;
}

void *va_alarm_create(void)
{
    int ret = xTaskCreate(alarm_play,
                          "alarm_play",
                          configMINIMAL_STACK_SIZE * 4,
                          NULL,
                          tskIDLE_PRIORITY + 1,
                          &g_handler_alarm);
    if (ret == pdPASS)
        return g_handler_alarm;
    else
        return NULL;
}

